import Container from "react-bootstrap/Container";
import CardStyle from "./Card";
import data from "../data/data.json"; // Asegúrate de que esta ruta sea correcta

export const CardList = ({ Datas, Loading, setCartArticle }) => (
  <Container className="d-flex flex-wrap mt-3" style={{ justifyContent: 'center', alignItems: 'center' }}>
    {Loading ? (
      <div>Loading...</div>
    ) : (
      (Datas.length > 0 ? Datas : data).map(person => {
        // Modifica el precio solo para el id 1
        if (person.id === 1) {
          person.price = 28;
        }

        return <CardStyle key={person.id} person={person} setCartArticle={setCartArticle} />;
      })
    )}
  </Container>
);
